import React from "react";
import { connect } from "react-redux";
import User from '../components/User';

export function Home({users}){
    return(
        <div className="justify-content-center w-75">
        <div className="justify-content-center w-50">
            <h4>DOCENTES</h4>
            <div class="input-group">
  <div class="form-outline">
    <input type="search" id="form1" class="form-control" />
    <label class="form-label" for="form1">Search</label>
  </div>
  <button type="button" class="btn btn-primary">
    <i class="fas fa-search"></i>
  </button>
</div>
            <div className="align-self-center">X</div>
        </div>
            {
                users && users.map(u => <div>
                    <User key={u.id} apellido={u.apellido} nombres={u.nombres}
                    docnro={u.docnro} email={u.email} domicilio={u.domicilio}
                    telefono={u.telefono} fechasalida={u.fechasalida} iddocente={u.iddocente}/>
                </div>)
            }
        </div>
    )
}

function mapStateToProps(state){
    return{
        users: state.users
    }
}

export default connect(mapStateToProps,null)(Home)
